import "./styles/App.css";
import firstPhoto from "./assets/maninheadphones.jpg"
import Section1 from "./components/Section1";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div style={{ margin: "auto" }}>
          <h1 style={{ margin: 0 }}>Castaway</h1>
        </div>
        <nav>
          <a href="#">Home</a>
          <a href="#">Episodes</a>
          <a href="#">About</a>
          <a href="#">Contact</a>
        </nav>
      </header>
      <Section1/>
      <section></section>
      <section></section>
      <section></section>
      <footer></footer>
    </div>
  );
}

export default App;
